import React from 'react'
import { useNavigate } from 'react-router-dom';

function Home() {
    const navigate = useNavigate();
    return (
    <>
        <h1>게임 설명</h1>
        <div>balance game.
            <br />
            마음에 드는 것을 골라보아요.
        </div>
        <button
        onClick={() => {
            navigate("/games");
        }}
        >입장하기</button>
    </>
    )
}

export default Home
